import { motion } from "framer-motion"
import estyle from "./AngleLine2.module.scss"

function AngleLine2({props}) {

    const svgVariants = {
        hidden: { opacity: 0 },
        visible: { opacity: 1, transition: { delay: props.delay, duration : 1 }}
    }

    const startdot = {
        ready: { opacity:0, scale:0 },
        start: { opacity:1, scale:1, 
            transition: {
                scale:{ 
                    delay: props.dot1delay, 
                    duration: props.dot1duration, 
                    type:'spring', 
                    bounce:1, 
                    velocity:1, 
                    stiffness:200, 
                    mass:1, 
                    damping:8 
                },
            }}
    }

    const enddot = {
        ready: { opacity:0, scale:0 },
        start: { opacity:1, scale:1, 
            transition: {
                scale:{ 
                    delay: props.dot2delay, 
                    duration: props.dot2duration, 
                    type:'spring', 
                    bounce:1, 
                    velocity:1, 
                    stiffness:200, 
                    mass:1, 
                    damping:8 
                },
            }}
    }

    const startline = {
        ready: { y:900, x: 0 },
        start: { y: 0, 
            transition: { 
                duration: props.lineduration, 
                delay: props.linedelay, 
                type:'tween', 
                ease:'easeOut' 
            }    
        }
    }

    return (
        <div>
           <svg width="557" height="58" viewBox="0 0 557 58" fill="none" xmlns="http://www.w3.org/2000/svg"
                variants={svgVariants}
                initial="hidden"
                animate="visible"
            >
                <defs>
                    <clipPath id="myclippath">
                    <motion.rect 
                        height="600" 
                        width="200"
                        variants={startline}
                        initial="ready"
                        animate="start"
                    />
                    </clipPath>
                </defs>

                <g clip-path="url(#clip0_61_14)">
                <path d="M1.99917 43.4366C3.10362 43.4366 3.99898 42.5413 3.99898 41.4368C3.99898 40.3324 3.10362 39.437 1.99917 39.437C0.894716 39.437 -0.000610352 40.3324 -0.000610352 41.4368C-0.000610352 42.5413 0.894716 43.4366 1.99917 43.4366Z" fill="black"/>
                <path d="M554.372 14.1465C555.477 14.1465 556.372 13.2512 556.372 12.1468C556.372 11.0423 555.477 10.147 554.372 10.147C553.268 10.147 552.372 11.0423 552.372 12.1468C552.372 13.2512 553.268 14.1465 554.372 14.1465Z" fill="black"/>
                <path d="M483.939 41.1787H3.93701V41.6787H483.939V41.1787Z" fill="black"/>
                <path fill-rule="evenodd" clip-rule="evenodd" d="M503.124 11.985L483.994 41.505H483.394L502.534 11.985H503.124Z" fill="black"/>
                <path d="M552.632 11.9137L502.632 11.9137V12.4137L552.632 12.4137V11.9137Z" fill="black"/>
                </g>
            </svg>
        </div>
    )
}
export default AngleLine2;


